import React from "react";
import { Row, Col } from "antd";
import Logo from '../HomePage/Atoms/Logo/Logo';
import Menu from '../HomePage/Molecules/Menu';
import Vip from '../HomePage/Atoms/Vip/Vip';
import ListLibrary from '../HomePage/Molecules/library/ListLibrary';
import Header from '../HomePage/Molecules/Header';
import PlayControl from '../HomePage/Molecules/PlayControl';
function Follow() {
  return (
    <>
      <Row>
        <Col className="left-content" span={4}>
          <Logo/>
            <Menu list={this.state.list1}/>
            <div className ="Slidebar">
              <Menu list={this.state.list2}/>
              <Vip/>
              <ListLibrary list={this.state.list3}/>
            </div>
             <h1>Hihihih</h1>
        </Col>
        <Col className="right-content" span={20}>
          <Header />
          <Row>
            <Col span={22} Foffset={1}>
              <h1>ddy la trang follow</h1>
            </Col>
          </Row>
        </Col>
      </Row>
      <PlayControl />
    </>
  );
}

export default Follow;
